import React from 'react';
import Navbar from '../components/Navbar';

const AboutPage = () => {
  return (
    <div>
      <Navbar
        links={[
          { label: 'Home', url: '#' },
          { label: 'About', url: '#about' },
          { label: 'Contact', url: '#contact' },
        ]}
      />
      <h1>About Page</h1>
      <p>This is the content of the about page.</p>
    </div>
  );
};

export default AboutPage;
